import React from "react";
import styled from "styled-components";

const Team = () => {
  return <Container></Container>;
};

export default Team;

const Container = styled.div`
  width: 100%;
  height: 60vh;
  background: url("/static/images/landing/teambw.png") center center no-repeat;
`;
